public sealed class LocaleManager : QuestClass
{
	public static Dictionary<string, Dictionary<Locale, string>> LocaleList = new Dictionary<string, Dictionary<Locale, string>>(){
    		{"Глаз",  new Dictionary<Locale, string>(){
      				{Locale.ruRU, "Глаз"},
      				{Locale.def, "The Ocular"},
      			}
    		},
		{"Зал Уфранга", new Dictionary<Locale, string>(){
      				{Locale.ruRU, "Зал Уфранга"},
      				{Locale.def, "Ufrang's Hall"},
			}
		},
		{"Кости врайкула", new Dictionary<Locale, string>(){
      				{Locale.ruRU, "Кости врайкула"},
      				{Locale.def, "Vrykul Bones"},
			}
		},
		{"Святилище воскрешения", new Dictionary<Locale, string>(){
      				{Locale.ruRU, "Святилище воскрешения"},
      				{Locale.def, "Sanctum of Reanimation"},
			}
		},
		{"Даларан", new Dictionary<Locale, string>(){
      				{Locale.ruRU, "Даларан"},
      				{Locale.def, "Dalaran"},
			}
		},

 	};
	public static string getLocale(string s){
		string ClientLocale = Lua.LuaDoString<string>("return GetLocale()");
		if(LocaleList.ContainsKey(s)){
			Dictionary<Locale,string> locales = LocaleList[s];
			foreach(KeyValuePair<Locale, string> kvp in locales){
				if(ClientLocale == kvp.Key.ToString())
					return kvp.Value;
			}
			return locales[Locale.def];
		}
		else
			return s;
	}
    public LocaleManager() // Don't forget to use good classe name
    {
    }

}
public enum Locale{
  ruRU,
  def,
}

public sealed class ZeppelinPoint : QuestClass
{
	public Vector3 currentPos;
	public Vector3 zeppelinPos;
	public float zeppelinAngle;
    public ZeppelinPoint() // Don't forget to use good classe name
    {

    }
    public ZeppelinPoint(Vector3 currentPos, Vector3 zeppelinPos, float zeppelinAngle){
		this.currentPos = currentPos;
		this.zeppelinPos = zeppelinPos;
		this.zeppelinAngle= zeppelinAngle;
	}
}

