	public static Vector3 newPoint(ZeppelinPoint point){
		Vector3 shipPos = point.zeppelinPos;
		Vector3 myPos = point.currentPos;
		float shipRot = point.zeppelinAngle;
		double Z = myPos.Z - shipPos.Z;

		double a = System.Math.Sqrt(System.Math.Pow((shipPos.X - myPos.X), 2)+System.Math.Pow((shipPos.Y - myPos.Y), 2));
		double angleX = System.Math.Atan((myPos.Y-shipPos.Y)/(myPos.X-shipPos.X))-shipRot;

		var ship = ObjectManager.GetObjectWoWGameObject().Where(u => u.IsValid && ((ObjectManager.Me.IsHorde && u.Entry == 192241) || (!ObjectManager.Me.IsHorde && u.Entry == 192242))).FirstOrDefault();
		shipPos = ship.Position;
		float shipRotation = ship.Rotation();

		double angleB = angleX + shipRotation;
		double newX = shipPos.X+a*System.Math.Cos(angleB);
		double newY = shipPos.Y+a*System.Math.Sin(angleB);

		Vector3 newPos = new Vector3(newX, newY, ship.Position.Z + Z, "Flying");
		return newPos;
	}
	public static float DistanceToMe(ZeppelinPoint point){
		Vector3 newPos = newPoint(point);
		return ObjectManager.Me.Position.DistanceTo(newPos);
	}
	public static float DistanceToMe2D(ZeppelinPoint point){
		Vector3 newPos = newPoint(point);
		return ObjectManager.Me.Position.DistanceTo2D(newPos);
	}
	public static bool ZeppelinMoveTo(ZeppelinPoint point){ //need to move (need - true, no need - false)
		Vector3 newPos = newPoint(point);	
		wManager.Wow.Helpers.MovementManager.MoveTo(newPos);
		if(ObjectManager.Me.Position.DistanceTo(newPos) > 3.5){	
			return false;
		}
		else
			return true;

	}
	public static void PauseWhileMove(){
		Thread.Sleep(500);
		while(Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause && ObjectManager.Me.GetMove){
			Thread.Sleep(150);
			Logging.Write("PauseWhileMove");
		}
	}
    public ZeppelinManager() // Don't forget to use good classe name
    {

    }
}

