while(Conditions.InGameAndConnectedAndAliveAndProductStartedNotInPause && !Quest.IsObjectiveComplete(1, 13144)){
	Conditions.ForceIgnoreIsAttacked = true;
	GoToTask.ToPosition(path[closest]);
	var zombie = ObjectManager.GetObjectWoWUnit().Where(u => u.IsAlive && u.Entry == 31048 && u.SummonedBy == ObjectManager.Me.Guid).FirstOrDefault();
	var target = zombie.TargetObject;
	if(zombie == null)
		break;
	else if(target != null && target.IsValid && target.Entry != 30689){
		Logging.Write("Starting fight with " +  target.Name + ", Entry = " + target.Entry + ", guid = "+ target.Guid);
		Fight.StartFight(target.Guid);
	}
	if(!ObjectManager.GetObjectWoWUnit().Any(u => u.IsAlive && u.Entry == 30689 && u.GetDistance < 10)){

		//if(zombie.TargetObject != null && zombie.TargetObject.Guid != 30689)
			//Fight.Start.Fight
		closest++;
	}
	Thread.Sleep(3000);
	if(!ObjectManager.GetObjectWoWUnit().Any(u => u.IsAlive && u.Entry == 31048 && u.SummonedBy == ObjectManager.Me.Guid))
		break;
}
Conditions.ForceIgnoreIsAttacked = false;
return true;

